met Mary Elizabeth Winstead, Eric Christian Olsen en Joel Edgerton

In een onderzoekskamp op Antartica leidt de ontdekking van een buitenaards schip tot een confrontatie tussen de studente Kate 
Lloyd en de wetenschapper Dr. Sander Halvorson. Terwijl Dr. Halvorson zich blijft richten op zijn onderzoek gaat Kate samen met
de helikopterpiloot Sam Carter op zoek naar de buitenaardse levensvorm.
